	<title>Preloder</title>

	<script type="text/javascript" src="JavaScript/jquery-3.6.0.js"></script>
    <script type="text/javascript" src="JavaScript/jquery-3.6.0.min.js"></script>
    <script type="text/javascript" src="JavaScript/TweenMax.min.js"></script>
    <script type="text/javascript" src="JavaScript/CSSPlugin.min.js"></script>
    <script type="text/javascript" src="JavaScript/TweenLite.min.js"></script>
    <script type="text/javascript" src="JavaScript/TimelineLite.min.js"></script>
    <script type="text/javascript" src="JavaScript/TweenMax-latest-beta.js"></script>

    <script type="text/javascript">
    	
    	$(document).ready(function() {

    //GSAP Preloading Frame
    var dots = $('.Bslash');
    //var loadBody = $('#loader');
    var loadbck = $('.bodyframe');
    var tloader = new TimelineMax({repeat: 2, onComplete:contentload});

    tloader.staggerFromTo(dots, 0.6, {autoAlpha: 0, ease:Power2.easeOut}, {autoAlpha: 1, ease:Power2.easeOut}, 0.3);
    
    function contentload(){
        var tLoaderOut = new TimelineLite({onComplete: ContentIn});
        tLoaderOut.to(loadbck, 0.5, {autoAlpha: 0, ease:Power2.easeOut}, '+=0.3');
    }

    
    function ContentIn() {
     loadbck.css('display', 'none');
	}

    	});

    </script>

	<style type="text/css">

	body{
		margin: 0;
        overflow-x: hidden !important;
    }

    .bodyframe{
        position: absolute;
        width: 100%;
        height: 100%;
        background-color: #3e6274 !important;
        display: block;
        z-index: 250 !important;
    }

	#loader{
    position: absolute;
    top: 50%;
    left: 50%;
    transform: translate(-35%, -50%);
    opacity: 1;
    }

    .svg{
        display: block;
        width: 100vw;
        transform: scale(0.6) !important;
    }

    .Bslash{
        opacity: 0;
    }

    @media screen and (max-width: 925px){
        #loader{
            transform: translate(-40%, -50%) !important;
        }
        .svg{
        transform: scale(0.5) !important;
        }
    }

    @media screen and (max-width: 768px){
        #loader{
            transform: translate(-37%, -50%) !important;
        }

        .svg{
        display: block;
        width: 150vw;
         }
    }

    @media screen and (max-width: 640px){
        #loader{
            transform: translate(-40%, -50%) !important;
        }

        .svg{
        display: block;
        width: 200vw;
         }

         .svg{
        transform: scale(0.4) !important;
        }
    }

    @media screen and (max-width: 480px){
        .svg{
        transform: scale(0.3) !important;
        width: 225vw;
        }
        #loader{
            transform: translate(-45%, -50%) !important;
        }
    }

    @media screen and (max-width: 350px){
        #loader{
            transform: translate(-47%, -50%) !important;
        }
        .svg{
        transform: scale(0.2) !important;
        width: 250vw;
        }
    }

	</style>
